//SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.7.0;

contract Election {

    struct Candidate{
        uint id;
        string name;
        uint vote_count;
    }

    uint public candidateCount;
    mapping(uint => Candidate) public candidates;
    mapping(address => bool) public voted;
    event electionUpdated(
        uint id,
        string nmae,
        uint vote_count
    );
    constructor(){
        candidateCount = 0;
        addCandidate("Barack Obama");
        addCandidate("Donald Trump");
    }

    function addCandidate(string memory name) public{
        candidateCount++;
        candidates[candidateCount] = Candidate(candidateCount, name, 0);
    }

    function Vote(uint _id) public{
        require(!voted[msg.sender],"Already Voted");
        require(candidates[_id].id != 0,"Candidate does not exist");
        voted[msg.sender] = false;
        candidates[_id].vote_count += 1;
        emit electionUpdated(_id, candidates[_id].name, candidates[_id].vote_count);
    }

}
